        desc: '<div class="pane" style="display: block;"><div><div class="image parbase section"><div class="image " data-src="/content/dam/graco/ced/images/outline/EPower_600.jpg"> <div class="image parbase section"><div class="image " data-src="/content/dam/graco/ced/images/outline/EPower_600.jpg">Indusktrijska prva mašina za signalizaciju, LineLazer ES 1000,&nbsp;se pokreće zahvaljujući bateriji visokog kapaciteta koja omogućava sigurnost u zatvorenom prostoru, a istovremeno ima dovoljno snage za poslove na otvorenom.&nbsp;„Go Green“ sa tihom i bez dima, mašinom za signalizaciju!</div> </div><div class="parbase section text"><p><b>Bez buke motora</b><br>Radite bilo koji posao bez ometajuće buke motora.</p> <p><b>Bez vibracije motora</b><br>Omogućuje savršene linije na svim površinama i smanjuje umor korisnika.</p> <p><b>Bez dima od motora</b><br>Omogućava rad u zatvorenom prostoru bez zaustavljanja.</p> <p><b>Duboki ciklus 100AH AGM&nbsp;baterije</b><br> Akumulator je dizajnira tako da je pre narednog punjenja moguće utrošiti 76 L materijala za signalizaciju. Priključivanje paralelno dodatne baterije povećava se kapacitet, smanjuje se pad napona prilikom opterećenja i omogućava se trostroko više vremena za kontinuirani rad pre punjenja (do 227 L).</p> <p><b>Ugrađeni&nbsp;12V&nbsp;punjač</b><br>Bez uklanjanja baterije, jednostavno priključite kako biste je ponovo napunili.</p> <p><b>120V kapaciteta/&nbsp;230V in EMEA</b><br>Beskonačno izvlačenje linija zahvaljujući stacionarnoj aplikaciji na&nbsp;120V&nbsp;(230V in EMEA). Samo je priključite.</p> <p><b>Smart kontrola 2.5</b><br>Napredni sistem za kontrolu pritiska omogućava stalni ventilator za prskanje što rezultuje boljem kvalitetu linija.</p> <p><b>Ekskluzivna izdržljivost pumpe</b><br>Proveren kvalitet pumpe, najbolji u industriji.</p> <p><b>Novi ProConnect&nbsp;sistem</b><br>Omogućava brzu zamenu pumpe prilikom rada.</p><p><b>FastFlush</b><br>FastFlush&nbsp; sistem za čišćenje sa velikim protokom omogućava brži rad i dramatčno smanjuje vreme čišćenja. Prvi put dostupan kod električne mašine za obeležavanje.</p> <p><b>Novi sistem za podešavanje pištolja</b><br>Inovativni dizajn pištolja sa&nbsp;„G“ sistemom držača spone.</p> <p><b>Ekskluzivna&nbsp;LineLazer&nbsp;kolica</b><br> Najbolje izbalansirana šasija u industriji za obeležavanje.</p> </div><p>&nbsp;</p></div><div class="image " data-src="/content/dam/graco/ced/images/outline/EPower_600.jpg"></div> <div class="image " data-src="/content/dam/graco/ced/images/outline/EPower_600.jpg">The industry’s first electric striper, the LineLazer ES 1000 is powered by a high-output battery allowing it to be used safely indoors while having the power and performance needed for outdoor jobs. „Go Green“ with this quiet, fume-free striper!</div> </div><div class="parbase section text"><p><b>No Engine Noise&nbsp;</b><br>Do any job anytime without disruptive engine noise.</p> <p><b>No Engine Vibration</b><br>Allows for perfect lines on all surfaces and reduces user fatigue.</p> <p><b>No Engine Fumes</b><br>Enables you to stripe indoors without production shut downs or disruptions.</p> <p><b>Deep Cycle 100AH AGM Battery</b><br>Maintenance-free sealed battery design for striping up to 20 gallons per charge. Adding a second battery connected in parallel increases capacity, reducing voltage drop while under load, and triples run time allowing you to stripe up to 60 gallons per charge.</p> <p><b>On-board 12V Charger</b><br>Simply plug in to recharge, no need for battery removal.</p> <p><b>120V Capacity /&nbsp;230V in EMEA</b><br>Get infinite striping time when using for stationary applications by running on 120V wall power&nbsp;(230V in EMEA). Just plug it in.</p> <p><b>SmartControl 2.5</b><br>Advanced pressure control system delivers consistent spray fan resulting in unmatched line quality.</p> <p><b>Exclusive Endurance Pump</b><br>Industry-best pump performance in this field-proven design.</p> <p><b>New ProConnect System</b><br>Industry-first for walk-behind stripers allows quick on the job pump replacement.</p> <p><b>FastFlush</b><br>FastFlush high flow cleaning system runs faster and dramatically reduces cleaning time. Available for the first time on a walk-behind striper.</p> <p><b>New Gun Adjustment System</b><br>Innovative gun adjustment design with „G“ Clamp holder system.</p> <p><b>Exclusive LineLazer Cart</b><br>Industry’s best balanced chassis for all day striping comfort.</p> </div></div><div class="clear"></div></div>',
