        desc: '<div class="pane" style="display: block;"> <div><p>Zahvaljujući sistemu 98:2 i mešanju 2 komponetne,&nbsp;sigalizacija puteva nikad nije bila pouzdanija sa LineLazer V 250mma 98:2.&nbsp;Zasnovana na opsegu LineLazer V 250, ova mašina priža sve: 98:2 ima mogućnost mešanja i osiguran odnos, rezervoare za skladištenje i mogućnost ispiranja rastvarača.</p> <ul><li>Sistem automatskog upravljanja pištoljom</li> <li>Ekslzivna platforma za stajanje</li> <li>Centrirani prednji točak</li><li>EasyMark sistem za podešavanje pištolja</li> <li>Sistem perli pod pritiskom</li><li>Ekslzivni 98:2&nbsp;sistem za mešanje</li> </ul><p>&nbsp;</p><p>Spraying 2-component 98:2 road markings has never been more reliable with LineLazer V 250mma 98:2. Based upon the LineLazer V 250 range, this unit provides it all: built in 98:2 mixing capabilities and Ratio Assurance, on-board storage tanks and solvent flushing capabilities.</p> <ul><li>Automatic Gun Control System</li> <li>Exclusive Stand-On Platform</li> <li>Self-Centering Front Wheel</li><li>EasyMark Gun Adjustment System</li> <li>Pressurized Bead System</li><li>Exclusive 98:2 Mixing System</li> </ul></div><div class="clear"></div></div>',
