        id: 6,
        desc: '<div class="pane" style="display: block;"><div><p>Obeležavanje sa ekskluzivnim automatskim pištoljom za boju čine LineLazer V 250SPS<b>&nbsp;</b>i&nbsp;250 DC omiljenim mašinama za signalizaciju koje zahtevaju hidrauličnu snagu.&nbsp; Idealni su za obimnije poslove, kao što je obeležavanje puteva i parking mesta.</p> <div class="image"></div><div class="text"><p><b>Karakteristike HP automatske serije:</b></p> <ul><li>EasyMark sistem za podešavanje pištolja—Jednostavan sistem koji omogućava da se svaki put pištolj postavi savršeno</li> <li>Automatski sistem za kontrolu pištolja—Ručni ili automatski pištolj za boju ili perle pokreće se pritiskom na dugme</li> <li>Automatsko postavljanje&nbsp;II—Ekskluzivni zeleni laser za navođenje skraćuje vreme duplo (zavisi od zemlje)</li> <li>Čuvanje podataka zahvaljujući J-Log sistemu—Čuva informacije kao dokaz o obavljenom poslu</li> <li>Snaga—12V&nbsp;baterija za dodatnu opremu</li> <li>Graco hidraulučni motorni sistem—Bez stajanja pruža neprekidne performanse</li> <li>25-Gallon (95 L) rezervoar za boju—Veliki kapacitet rezervoara omogućava duže vreme za signalizaciju</li> <li>Sistem klipne pumpe za izdržljivost—Pumpa dugo roka upotrebe omogućava precizan protok za široki spektar materijala za signalizaciju</li> <li>Ekskluzivni samocentrirani prednji točak— Omogućava jednostavan rad</li> <li>Sistem zadnjeg pištolja—Daje prave, duge linije</li> <li>Honda 13 hp GX motor—električni start</li> </ul></div><div>&nbsp;<b>HP Reflective Series uključuje&nbsp; sve karakteristike HP Automatic Series PLUS:</b></div> <div class="parbase section textimage"><div class="text"><ul><li>EZ sistem za perle pod pritiskom<ul><li>Inovativni rezervoar za perle</li><li>Pruža savršenu ugradnju perli</li><li>Vazdušni ventili za početak i zaustavljanje</li> <li>Instalirano i spremno za rad</li><li>Dupli rezervoari za perle nosivosti su do 109 kg (240 lbs) perli (svaki po 54,5 kg (120 lbs))</li> </ul></li></ul><p>&nbsp;</p></div></div><p>&nbsp;</p><p>High performance striping with the exclusive automatic paint guns makes the LineLazer V 250SPS<b>&nbsp;</b>and 250 DC<b>&nbsp;</b>the preferred stripers for professional contractors who demand hydraulic power. This stripers&nbsp;are ideal for large, heavy-duty line striping jobs including parking lots and road jobs.</p> <div class="image"></div><div class="text"><p><b>HP Automatic Series Features:</b></p><ul><li>EasyMark Gun Adjustment System—Simple guide mark and gun placement system allows for perfect gun set up every time</li> <li>Automatic Gun Control System—Manual or automatic paint and bead guns with the push of a button</li> <li>Auto-Layout II—Exclusive Green Laser Guidance cuts layout time in half (country dependant)</li> <li>Data Logging with J-Log System—On-board job information for proof of completion</li> <li>On-Board Power—12V battery for all your accessory items</li> <li>Graco Hydraulic Motor System—No-Stall design provides uninterrupted performance</li> <li>25-Gallon (95 L) Paint Hopper—Extended striping time with large capacity hopper</li> <li>Endurance Piston Pump System—Long life pump provides precise flow for wide range of striping materials</li> <li>Exclusive Self-Centering Front Wheel—Provides simpler operation</li> <li>Rear Gun Mount System—Provides straighter long lines</li> <li>Honda 13 hp GX Engine—Electric start for ease of use</li> </ul><p><b>HP Reflective Series Includes All HP Automatic Series Features PLUS:</b></p> </div><div class="parbase section textimage"><div class="text"><ul><li>EZ Bead Pressurized System<ul><li>Innovative bead tank with unmatched performance</li> <li>Provides perfect bead embedment</li><li>Air valves to dial in starts and stops</li> <li>Installed and ready to go</li><li>Dual Bead Tanks hold up to 240 lbs of beads (120 lbs each)</li> </ul></li></ul></div></div></div><div class="clear"></div></div>',
