        desc: '<div class="pane" style="display: block;"><div><p>Graco&nbsp;RoadLazer je profesionalna mašina za signalizaciju puteva.&nbsp;Oba modela RoadLazer su dizajnirana za upravljanje jednom osobom:</p> <ol><li>RoadPak System nudi visoku produktivnost, bezvazdušno označavanje, i precizne linije. Dvostruka prskalica omogućava bolju kontrolu prskanja.</li> <li>RoadLazer RoadPak je sistem za izlačenje traka&nbsp;koji ima više prostora za boju i opremu. Odaberi jednu ili dve&nbsp;&nbsp;RoadPak pumpe za jednu boju ili dve prilikom upotrebe. Spojnice su takvog dizajna da mogu biti i kao vozilo. Njegov dizajn omogućava prave linije i blage prelaze u krivine.</li> </ol><p>Naša oprema za signalizaciju pruža dugotrajnost sa minimalnim održavanjem.</p> <p>&nbsp;</p><p>Graco&nbsp;RoadLazer striping equipment is for the professional road striping contractor. Both models of the RoadLazer are designed for a one person operation. Select from two models:</p> <ol><li>The RoadPak System offers high productivity, airless striping, and accurate lines. The double acting bead spray gun has better on/off control which eliminates chattering over competitor guns.</li> <li>The RoadLazer RoadPak is a tow-behind striping system which gives you more room for paint supplies and equipment. Choose from one or two RoadPak pumps for one color or two color applications. Our hitches have a patented design making them a part of the vehicle. This design allows for straighter lines and smooth transitions into curves.</li> </ol><p>Our striping equipment offers long life and low maintenance. Learn more about the specific features of each of the RoadLazer striping models to determine which machine fits your needs and project&nbsp;size.</p> </div><div class="clear"></div></div><div class="pane" style="display: block;"><h3><b>Opremljen novim funkcijama:</b></h3> <p><b>Nove visoke performanse</b><br> 2 puta veći izlaz</p><p><b>Novi visokog kapaciteta rezervoar</b><br> 3&nbsp;puta većeg volumena</p><p><b>Novi RoadPak HD&nbsp;cev pištolja</b><br> 5+&nbsp;kapacitet pištolja</p><p><b>Novi napredni kontrolor</b><br> Za aerodrome i&nbsp;puteve</p><p><b>Novo sedište za upravljača</b><br> Laka kontrola</p><p><b>Nov način upravljanja</b><br> Upravljanje komadnom palicom i regulacija brizine</p> <p><b>Novi hidraulični rezervoar visokog kapaciteta</b><br> 2&nbsp;puta veći volumen</p><p><b>Novi napredni sistem hlađenja</b><br> 2&nbsp;puta brže hlađenje</p><p><b>Novi izlazni&nbsp;Koehler&nbsp;motor</b><br> 40%&nbsp;više konjske snage</p><p><b>Novi RoadView HD&nbsp;kamera sistem</b><br> HD camera&nbsp;sa&nbsp;ekranom</p> <p><b>Novi LazerGuide 3000</b><br> Laser za prave linije&nbsp;(opciono)</p> <h3></h3><h3><b>Packed with New Features:</b></h3> <p><b>New Higher Performance</b><br> 2 times the output</p><p><b>New High-Capacity Bead Tank</b><br> 3 times the volume</p><p><b>New RoadPak HD Gun Bar</b><br> 5+ gun capacity</p><p><b>New Advanced Controller</b><br> Airport and road patterns built-in</p> <p><b>New Rear Operator Seat</b><br> All controls easily within reach</p> <p><b>New Steerable Carriage</b><br> Joystick operation and variable speed control</p> <p><b>New High-Capacity Hydraulic Reservoir</b><br> 2 times the volume</p><p><b>New Advanced Cooling System</b><br> 2 times the cooling capacity</p><p><b>New Higher Output Koehler Engine</b><br> 40% more horsepower</p><p><b>New RoadView HD Camera System</b><br> HD camera and in-cab display</p><p><b>New LazerGuide 3000</b><br>Long line laser for straight lines (optional)</p> <div class="clear"></div></div>',
