        desc: '<div class="pane" style="display: block;"> <div><p>Predstavljamo prvi i jedini bežični stacionarni raspršivač visokih performansi. Dizajniran da pruži sve performanse kao i 390 PC sa kablom, samo bez&nbsp; kablova za napajanje, električnih utičnica ili generatora. Iskusite snagu i slobodu za brže obavljanje svakog posla.</p> <p>JEDINI akumulatorski raspršivač visokih performansi— do o 3,300 psi sa max diznom od 0.021 inch. Raspršuje do 11 L sa jednim punjenjem baterije — dve baterije uključene za celodnevno raspršivanje. Proširene mogućnosti raspršivanja bilo gde!</p> <ul><li><strong>Prednosti koje ćete ceniti na svakom poslu:</strong> <ul><li>Postavite gde želite umesto gde se nalazi napajanje</li> <li>Konzistentna, celodnevna snaga prskanja bez oscilacija u snazi</li> <li>Obezbedite savršene završne obrade bez vazduha uz produženo vreme rada i sa RAC X diznom pod niskim pritiskom</li> <li>Prestanite da gubite vreme baveći se dugim produžnim kablovima</li> <li>Mala težina olakšava kretanje i transport</li> <li>Bez bučnih generatora</li></ul></li><li><strong>Snaga sa DEWALT®</strong><ul><li>FLEXVOLT baterije velikog kapaciteta, 6ah — prskajte do 11 L bez punjenja baterije</li> <li>Isporučuje se u kompletu sa dve baterije</li> <li>Brzi punjač hlađen ventilatorom—puni bateriju za manje od 60 minuta</li> </ul></li><li><strong>DC motor bez četkica</strong> <ul><li>Snažni DC motor bez četkica obezbeđuje produženo vreme rada baterije</li> <li>Lagan, kompaktan dizajn omogućava veću prenosivost</li> </ul></li><li><strong>Izdržljiva pumpa</strong><ul><li>Traje dva puta duže od vodećih istih pumpi</li> <li>Dugotrajna, od nerđajućeg čelika</li> <li>Brže čišćenje sa QuikAccess usisnim ventilom</li> </ul></li><li><strong>ProConnect jednodelni sistem zamene</strong> <ul><li>Eliminišite skupe zastoje</li><li>Brza i laka zamena pumpi za nekoliko minuta</li> </ul></li><li><strong>Prednost pogona</strong><ul><li>Najdugotrajnija vožnja</li><li>Zupčanici od čelika pružaju izuzetno tih rad i doživotnu garanciju</li> </ul></li><li><strong>Filter</strong><ul><li>Lako održavanje i smanjena mogućnost začepljenja</li> <li>Ekskluzivni proces filtriranja iznutra napolje obezbeđuje kvalitetnu završnu obradu</li> </ul></li><li><strong>Podesiva kontrola pritiska</strong> <ul><li>Omogućava 0-3,300 psi i obezbeđuje produženo vreme rada baterije pri prskanju pod niskim pritiskom</li> </ul></li><li><strong>Čvrsti čelični okvir</strong></li> <li><strong>RAC X Low Pressure (LP) SwitchTip</strong> <ul><li>Prskajte pod nižim pritiskom za produženo vreme rada baterije, manje raspršivanja, najduži vek trajanja dizne</li> </ul></li></ul><p>&nbsp;</p><p>&nbsp;</p><p>Introducing the first and only cordless high performance stationary paint sprayer. Designed to deliver all the performance of a corded 390 PC airless sprayer along with the freedom from power cords, electrical outlets or generators. Experience the power and freedom to spray every job faster.</p> <p>The ONLY High performance cordless paint sprayer — up to 3,300 psi with 0.021 inch max tip. Sprays up to 3 gallons on a single battery charge — two batteries included for all day spraying. Expanded application capability to spray anywhere!</p> <ul><li><strong>Benefits You’ll Appreciate on Every Job:</strong> <ul><li>Setup where you want instead of where the power is located</li> <li>Consistent, all-day spraying power without power fluctuations</li> <li>Deliver perfect airless finishes with extended runtime and RAC X Low Pressure SwitchTips</li> <li>Eliminate competing for power with other trades</li> <li>Stop wasting time dealing with long extension cords</li> <li>Lightest weight makes it easier to move and transport</li> <li>Experience quiet jobsites with battery power instead of using noisy generators</li> </ul></li><li><strong>Powered by DEWALT®</strong><ul><li>High capacity 6ah FLEXVOLT batteries — spray up to 3 gallons per battery charge</li> <li>Delivered complete with two batteries</li> <li>Fan-cooled fast charger—recharges battery in under 60 minutes</li> </ul></li><li><strong>Brushless DC Motor</strong><ul><li>Powerful brushless DC motor provides extended battery run time</li> <li>Lightweight, compact design allows for increased portability</li> </ul></li><li><strong>Durable Endurance Piston Pump</strong> <ul><li>Lasts 2X longer than the next leading brand</li> <li>Long Life V-Max Blue Packings, Chromex rod and hardened stainless steel cylinder</li> <li>Faster cleaning with the QuikAccess intake valve</li> </ul></li><li><strong>ProConnect One-Part Replacement System</strong> <ul><li>Eliminate costly downtime</li><li>Fast and easy pump swaps in minutes</li> </ul></li><li><strong>Advantage Drive</strong><ul><li>The longest lasting drive</li><li>Hardened steel gears provide extremely quiet operation and a lifetime warranty</li> </ul></li><li><strong>Easy Out Pump Filter</strong> <ul><li>Easy maintenance &amp; less clogging</li> <li>Exclusive inside-out filtering process ensures quality finish</li> </ul></li><li><strong>Adjustable Pressure Control</strong> <ul><li>Allows for 0-3,300 psi and delivers extended battery run time when spraying at low pressure</li> </ul></li><li><strong>Rugged Steel Frame</strong><ul><li>Thick chrome over steel withstands jobsite abuse</li> </ul></li><li><strong>RAC X Low Pressure (LP) SwitchTip</strong> <ul><li>Spray at lower pressure for extended battery runtime, less overspray, longest tip life</li> </ul></li></ul></div><div class="clear"></div></div>',
