        id: 21,
        desc: '<div class="pane" style="display: block;"> <div><p>Najmoćniji električni raspršivač bez vazduha. <b>TexSpray Mark X</b>&nbsp;je ozbiljni profesionalni raspršivač sa skoro duplim učinkom od Mark V.&nbsp;Lako za raspršivanje sa nivom 5&nbsp;završne teksture, kao i svih prajmera i boja.</p> <p><b>Radi pametnije, za više obavljenog posla.</b>&nbsp;TexSpray Mark ProContractor serija električnih raspršivača dizajnirani su za brz rad, kako bi se obavio veći broj poslova i uvećala zarada.&nbsp;.</p> <div class="parbase image_left section textimage"> <div class="text"><p><b>Izdržljiva&nbsp;Vortex MaxLife Piston&nbsp;puma</b></p> <ul><li>Vrhunski radni vek pumpe</li><li>Rotirajuća tehnologija</li><li>Traje 6X duže između prepakivanja&nbsp;sa novom&nbsp;MaxLife&nbsp;tehnologijom</li> </ul></div></div><div class="parbase image_left section textimage"> <div class="image"></div><div class="text"><p><b>LED&nbsp;ekran</b></p><ul><li>Lako očitavanje sa ekrana, na kom su dostupne sledeće informacije: <ul><li>Pritisak</li><li>Posao/vreme trajanja/potrošnja</li> <li>Dijagnostika</li></ul></li></ul></div></div><div class="parbase image_left section textimage"> <div class="image"></div><div class="text"><p><b>SmartControl 4.0 sa ProGuard&nbsp;zaštitnim sistemom</b></p> <ul><li>Precizna kontrola pritiska</li> <li>Konstantno raspršivanje&nbsp;bez variranja pritiska</li> <li>ProGuard&nbsp;štiti od ekstremnih uslova napajanja na gradilištu</li> <li>WatchDog Pump Protection System automatski sprečava oštećenje pumpe ako je snabdevanje materijala nisko</li> </ul></div></div><div class="parbase image_left section textimage"> <div class="image"></div><div class="text"><p><b>BlueLink Job &amp; Sprayer Management System</b></p> <ul><li>Pojednostavite svoj posao</li><li>Pratite svaki raspršivač: Tačna lokacija i produktivnost po satu</li> <li>Znajte napredak posla:&nbsp;Izveštavanje sa bilo kog mesta</li> <li>Maksimalno produžite vreme: postavite rasporede održavanja, upozorenja i beleške o veb lokacijama</li> <li>Više informacija na:&nbsp;<a href="https://www.graco.com/bluelink">graco.com/BlueLink</a></li> </ul></div></div><div class="parbase image_left section textimage"> <div class="image"></div><div class="text"><p><b>FastFlush 2 System</b></p><ul><li>Još brže čišćenje</li><li>Očistite pumpu&nbsp;6X brže korišćenjem ½&nbsp;vode</li> <li>Protok tečnosti isporučuje se sa 60% većom brzinom motora</li> </ul></div></div><div class="parbase section text"><p><b>QuikReel&nbsp;sistem za upravljanje crevima – Jednostavno upravljanje crevima</b></p> <ul><li>U sekundi aktivirajte i premotajte crevo do 150 metara (300 stopa)</li> <li>Nema uvrtanja, savijanja i namotavanja</li> <li>Koristite samo crevo koje vam je potrebno – ostatak ostaje na kolutu</li> </ul><p><b>MaxFlo 2 sa Pack-Out&nbsp;zaštitiom</b></p> <ul><li>Manje pakovanja, veća produktivnost</li> <li>Vibra-Seal tehnologija samočišćenja eliminiše nakupljanje materijala</li> <li>Kontinuirano raspršivanje sa&nbsp;True Pack-Out Protection&nbsp;za veću produktivnost</li> <li>Optimizirani protok za tečnost za najteže premaze</li> </ul><p><b>ProConnect 2&nbsp;sistem zamene pumpi</b></p> <ul><li>Bez zastoja</li><li>Promena pumpe za nekoliko minuta</li> <li>Bez alata</li></ul><p><b>MaxPower Motor &amp; Precision Advantage Drive</b></p> <ul><li>Dokazana snaga i performanse za sve farbarske aplikacije</li> <li>Dizajn bez četkice sa doživotnom garancijom</li> <li>Najduža vožnja</li><li>Ojačani čelični zupčanici pružaju izuzetno miran rad i doživotnu garanciju</li> </ul><p><b>Crushproof Inlet Strainer&nbsp;</b></p> <ul><li>Izdržljiva filtracija</li><li>Ravnomerni protok kroz filter</li> </ul><p>Dodatne funkcije</p><ul><li>EasyOut filter&nbsp;razvodnik</li> <li>Zaporni ventil za teške uslove rada</li> <li>Izdržljiv dizajn kolica</li></ul></div><p>&nbsp;</p><p>&nbsp;</p><p>THE most powerful electric airless texture sprayer. The&nbsp;<b>TexSpray Mark X</b>&nbsp;is the sprayer of choice for serious professional contractors with nearly double the output of the Mark V. It easily sprays skim coat in a Level 5 finish, multiple texture finishes and the all primers and paints.</p> <p><b>Work Smarter, Finish More Jobs.</b>&nbsp;TexSpray Mark ProContractor Series electric airless texture sprayers are designed to deliver speed &amp; performance so you can get to the next jobsite faster and increase your profits.</p> <div class="parbase image_left section textimage"> <div class="text"><p><b>Endurance Vortex MaxLife Piston Pump</b></p> <ul><li>Superior pump life</li><li>Breakthrough vortex rotating rod technology</li> <li>Lasts 6X longer between repacks with innovative MaxLife technology</li> <li>Oversized passages for high velocity flow to rotate piston for even wear Longest life packings and piston rod Long life ceramic and stainless steel balls included for maximum versatility</li> </ul><p><b>LED Display&nbsp;</b></p></div></div><div class="parbase image_left section textimage"> <div class="text"><ul><li>Easy-to-read display provides quick reference to show: <ul><li>Pressure read-out</li><li>Job/lifetime/gallon counter</li> <li>Self-diagnostics</li></ul></li></ul><p><b>SmartControl 4.0 with ProGuard Protection System</b></p> </div></div><div class="parbase image_left section textimage"> <div class="text"><ul><li>Precision Pressure Control</li> <li>Lowest dead band at any pressure delivers a consistent spray fan without pressure fluctuation</li> <li>ProGuard prevents electrical damage from extreme jobsite power conditions</li> <li>WatchDog Pump Protection System automatically prevents pump damage if material supply is too low</li> </ul><p><b>BlueLink Job &amp; Sprayer Management System</b></p> </div></div><div class="parbase image_left section textimage"> <div class="text"><ul><li>Streamline your business</li><li>Track every sprayer: Exact location &amp; hourly productivity</li> <li>Know job progress: On demand productivity facts and reporting from anywhere</li> <li>Maximize uptime: Set maintenance schedules, alerts, &amp; jobsite notes</li> <li>More info:&nbsp;<a href="https://www.graco.com/bluelink">graco.com/BlueLink</a></li> </ul><p><b>FastFlush 2 System</b></p></div></div><div class="parbase image_left section textimage"> <div class="text"><ul><li>Fast cleaning now even FASTER</li> <li>Clean the pump 6X faster using ½ the water</li> <li>High-velocity fluid flow delivered with 60% higher motor speed</li> </ul></div></div><div class="parbase section text"><p><b>QuikReel Hose Management System Easy Hose Management</b></p> <ul><li>Deploy and rewind up to&nbsp;150 meter (300 feet) of hose in seconds</li> <li>No twisting, kinking, and coiling</li> <li>Use only the hose you need — the rest stays on the reel</li> </ul><p><b>MaxFlo 2 with Pack-Out Protection</b></p> <ul><li>Less pack-out, more productivity</li> <li>Self-cleaning Vibra-Seal Technology eliminates material build-up</li> <li>Continuous spraying with True Pack-Out Protection for more productivity</li> <li>Optimized fluid passageways for the heaviest coatings</li> </ul><p><b>ProConnect 2 Pump Replacement System&nbsp;</b></p> <ul><li>Eliminate costly downtime</li><li>Exchange pump in minutes</li><li>No tools, pins or parts to lose</li> </ul><p><b>MaxPower Motor &amp; Precision Advantage Drive</b></p> <ul><li>Proven power and performance for all painting applications</li> <li>High-torque brushless design with a Lifetime Warranty</li> <li>The longest lasting drive</li><li>Hardened steel gears provide extremely quiet operation and a lifetime warranty</li> </ul><p><b>Crushproof Inlet Strainer&nbsp;</b></p> <ul><li>Durable filtration</li><li>Stands up to harsh impacts to maintain even flow through filter</li> </ul><p><b>Additional Features</b></p><ul><li>EasyOut Filter Manifold</li><li>Heavy Duty Prime Valve Rugged,</li> <li>Durable Cart Design</li></ul></div></div><div class="clear"></div></div>',
