        spec: '<div class="pane" style="display: block;"><p><strong>Specifikacije:</strong></p> <table class="techspecs_table"> <tbody><tr><td class="techspecs_title" colspan="2"><strong>T-Max 506/657 Texture Sprayer</strong></td> </tr><tr><td class="techspecs_subheader" colspan="2">T-Max 506</td> </tr><tr><td class="techspecs_desc">Power requirements</td> <td class="techspecs_value"> <div class="metricvalue">100 – 120 Vac, 50/60 Hz, 13A. 220 – 240 Vac, 50/60 Hz, 8A</div> </td></tr><tr><td class="techspecs_desc">Motor HP (W)</td> <td class="techspecs_value"> <div class="metricvalue">(900 W)</div> </td></tr><tr><td class="techspecs_desc">Maximum air working pressure</td> <td class="techspecs_value"> <div class="metricvalue">(1.7 MPa, 17 bar)</div> </td></tr><tr><td class="techspecs_desc">Maximum fluid working pressure</td> <td class="techspecs_value"> <div class="metricvalue">(5.0 MPa, 50 bar)</div> </td></tr><tr><td class="techspecs_desc">Generator required</td> <td class="techspecs_value"> <div class="metricvalue">7 kW</div> </td></tr><tr><td class="techspecs_desc">Hopper capacity:</td> <td class="techspecs_value"></td> </tr><tr><td class="techspecs_desc">Maximum</td> <td class="techspecs_value"> <div class="metricvalue">(76 liters)</div> </td></tr><tr><td class="techspecs_desc">Operating</td> <td class="techspecs_value"> <div class="metricvalue">(61 liters)</div> </td></tr><tr><td class="techspecs_desc">Maximum delivery with texture material</td> <td class="techspecs_value"> <div class="metricvalue">(4,5 to 6,4 lpm)</div> </td></tr><tr><td class="techspecs_desc">Fluid outlet size</td> <td class="techspecs_value"> <div class="metricvalue">1.0 in. (f) cam and groove</div> </td></tr><tr><td class="techspecs_desc">Dimensions:</td> <td class="techspecs_value"></td> </tr><tr><td class="techspecs_desc">Length</td> <td class="techspecs_value"> <div class="metricvalue">(102 cm to 140 cm)</div> </td></tr><tr><td class="techspecs_desc">Width</td> <td class="techspecs_value"> <div class="metricvalue">(56 cm)</div> </td></tr><tr><td class="techspecs_desc">Height</td> <td class="techspecs_value"> <div class="metricvalue">(79 cm)</div> </td></tr><tr><td class="techspecs_desc">Weight:</td> <td class="techspecs_value"></td> </tr><tr><td class="techspecs_desc">Without hoses or applicator</td> <td class="techspecs_value"> <div class="metricvalue">(64 kg)</div> </td></tr><tr><td class="techspecs_desc">With hoses and applicator</td> <td class="techspecs_value"> <div class="metricvalue">(75 kg)</div> </td></tr><tr><td class="techspecs_desc">T-Max 657</td> <td class="techspecs_value"></td> </tr><tr><td class="techspecs_desc">Power requirements</td> <td class="techspecs_value"> <div class="metricvalue">100 – 120 Vac, 50/60 Hz, 13A. 220 – 240 Vac, 50/60 Hz, 8A</div> </td></tr><tr><td class="techspecs_desc">Motor HP (W)</td> <td class="techspecs_value"> <div class="metricvalue">(900W)</div> </td></tr><tr><td class="techspecs_desc">Maximum air working pressure</td> <td class="techspecs_value"> <div class="metricvalue">(1.7 MPa, 17 bar)</div> </td></tr><tr><td class="techspecs_desc">Maximum fluid working pressure</td> <td class="techspecs_value"> <div class="metricvalue">(6.5 MPa, 65 bar)</div> </td></tr><tr><td class="techspecs_desc">Generator required</td> <td class="techspecs_value"> <div class="metricvalue">7 kW</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Hopper capacity:</td> </tr><tr><td class="techspecs_desc">Maximum</td> <td class="techspecs_value"> <div class="metricvalue">(106 liters)</div> </td></tr><tr><td class="techspecs_desc">Operating</td> <td class="techspecs_value"> <div class="metricvalue">(91 liters)</div> </td></tr><tr><td class="techspecs_desc">Maximum delivery with texture material</td> <td class="techspecs_value"> <div class="metricvalue">(5,3 to 7,2 lpm)</div> </td></tr><tr><td class="techspecs_desc">Fluid outlet size</td> <td class="techspecs_value"> <div class="metricvalue">1.0 in. (f) cam and groove</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Dimensions:</td> </tr><tr><td class="techspecs_desc">Length</td> <td class="techspecs_value"> <div class="metricvalue">(102 cm to 140 cm)</div> </td></tr><tr><td class="techspecs_desc">Width</td> <td class="techspecs_value"> <div class="metricvalue">(56 cm)</div> </td></tr><tr><td class="techspecs_desc">Height</td> <td class="techspecs_value"> <div class="metricvalue">(49 cm)</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Weight:</td> </tr><tr><td class="techspecs_desc">Without hoses or applicator</td> <td class="techspecs_value"> <div class="metricvalue">(66 kg)</div> </td></tr><tr><td class="techspecs_desc">With hoses and applicator</td> <td class="techspecs_value"> <div class="metricvalue">(81 kg)</div> </td></tr><tr><td class="techspecs_desc">Wetted parts</td> <td class="techspecs_value"> <div class="metricvalue">Buna-N, aluminum, brass, polyethylene, neoprene, stainless steel, chrome-plated, steel, nickel-plated carbon steel, fluoroelastomer, nickel-plated iron, wool felt, tungsten carbide, PTFE</div> </td></tr><tr><td class="techspecs_desc">Sound data for sprayer:</td> <td class="techspecs_value"></td> </tr><tr><td class="techspecs_desc">Sound pressure level</td> <td class="techspecs_value"> <div class="metricvalue">82.4 dB(A)</div> </td></tr><tr><td class="techspecs_desc">Sound power level</td> <td class="techspecs_value"> <div class="metricvalue">97.0 dB(A)</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Sound Pressure level measured at 1 m</td> </tr><tr><td class="techspecs_subheader" colspan="2">Sound Power level measured per ISO-3744</td> </tr></tbody></table><div class="clear"></div></div>'
